import {
  CommentDate,
  CommentHeader,
  CommentInput,
  CommentInputWrap,
  CommentItem,
  CommentListWrap,
  CommentWriteBtn,
  CommentWriter,
} from '../../styles/dashboard/activityComment.styles';

const ActivityCommentSection = () => {
  return (
    <section>
      <CommentInputWrap>
        <CommentInput />
        <CommentWriteBtn>댓글달기</CommentWriteBtn>
      </CommentInputWrap>
      <CommentListWrap>
        <CommentItem>
          <CommentHeader>
            <CommentWriter>작성자 id : aa@naver.com</CommentWriter>
            <CommentDate>작서일: 2023-01-01</CommentDate>
            <CommentDate>수정일: 2023-01-01</CommentDate>

          </CommentHeader>
        </CommentItem>
      </CommentListWrap>
    </section>
  );
};

export default ActivityCommentSection;
